import React from "react";
import { View, Text, TouchableOpacity } from "react-native";
import { Avatar, Badge, Icon, withBadge } from "react-native-elements";
import Icone from "../Configs/Icone";
export default ({ navigation, titulo }) => {
  return (
    <View
      style={{
        flexDirection: "row",
        height: 50,
        backgroundColor: "#5BA3D9",
      }}
    >
      <View
        style={{
          flex: 0.8,
          alignContent: "center",
          justifyContent: "center",
          marginLeft: 5,
        }}
      >
        <TouchableOpacity onPress={() => navigation.openDrawer()}>
          <Icone color="#F38DAD" estilo={{ FontSize: 12 }} name="bars" />
        </TouchableOpacity>
      </View>
      <View
        style={{
          flex: 1.5,
          alignContent: "flex-start",
          justifyContent: "center",
        }}
      >
        <Text style={{ color: "#F38DAD", fontSize: 20 }}>{titulo}</Text>
      </View>
      <View
        style={{
          flex: 0.2,
          alignContent: "flex-end",
          justifyContent: "center",
        }}
      >
        <TouchableOpacity
          onPress={() => {
            navigation.navigate("TabVagas");
          }}
        >
          <Icone color="#F38DAD" estilo={{ FontSize: 12 }} name="bell" />
        </TouchableOpacity>
      </View>
    </View>
  );
};
